import React, {Component} from 'react';
import './Provider.css'

class Provider extends Component {
    render() {
        return (
            <div id="provider">
                <div className="container">
                    <h3 className="title">HomeGroup cung cp</h3>
                    <div className="horizontal-divider"/>
                    <div className="row">
                        <div className="col-md-3 category-item">
                            <img
                                src="data:image/png;base64,"
                                className="" alt="Thit K Ni Tht"/>
                            <a>
                                <h3>Thit K Ni Tht</h3>
                            </a>
                            <p>Ni tht HomeGroup l mt trong nhng cng
                                ty tt nht trong lnh vc Thit k v Thi cng Ni tht. i ng kin trc s nhiu
                                nm kinh nghim s lm hi lng qu khch hng.</p>
                        </div>
                        <div className="col-md-3 category-item">
                            <img
                                src="https://noithathomegroup.com/wp-content/uploads/2014/02/thicon-noithat-home-347x182_1.jpg"
                                className="" alt="Thi Cng Ni Tht"/>
                            <a>
                                <h3>Thi Cng Ni Tht</h3>
                            </a>
                            <p>i ng kin trc s, th thi cng nhiu nm kinh nghim, c tinh thn trch nhim
                                cao, t m trong tng cng on s mang n s tin tng v yn tm cho khch
                                hng.</p>
                        </div>
                        <div className="col-md-3 category-item">
                            <img
                                src="https://noithathomegroup.com/wp-content/uploads/2014/02/xuong-home-347x182_1.jpg"
                                className="" alt="Sn Xut  G"/>
                            <a>
                                <h3>Sn Xut  G</h3>
                            </a>
                            <p>Nh Xng rng hn 1500m2, Thit b my mc nhp khu Italia, dy chuyn sn xut t
                                ng ha, mang li sn phm hon ho ti tng gc cnh, p tng chi tit nh.</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Provider;
